BEGIN TRANSACTION;
CREATE TABLE `ORD` (
	`ord_no`	TEXT,
	`stock_code`	TEXT,
	`stock_name`	TEXT,
	`ord_type`	INTEGER,
	`contract_time`	TEXT,
	`contract_no`	TEXT,
	`price`	INTEGER,
	`qty`	INTEGER,
	`charge`	INTEGER,
	`tax`	INTEGER,
	`time`	DATETIME NOT NULL DEFAULT (datetime('now','localtime'))
);
CREATE INDEX `idx_ord_02` ON `ORD` (`time` );
CREATE INDEX `idx_ord_01` ON `ORD` (`stock_code` );
COMMIT;
